  false,\n\t\"url\": null,\n\t\"notes\": \"The oceanographic-meteorological data were
  collected during the months of September 1978 to April 1979 by the Baltimore Canyon
  Operators who are participants in the U.S. East Coast Rig Instrumentation Program.
  This data is submitted to comply with USGS Notice to Lesses 78-5. Data from the
  joint industry funded instrumented rig (PACESETTER III, operated by Mobil) is presented
  in the first section of the attached reports. Supplemental data collected by other
  operators is tabulated in the second section. The codes for cloud cover and visibility
  observations are also included.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
